package main

import (
	"fmt"
)

func merge(arr1 []int, arr2 []int) []int {

	var merged_arr []int

	// while both arrays have elements
	for len(arr1) > 0 && len(arr2) > 0 {
		if arr1[0] > arr2[0] {
			merged_arr, arr2 = append(merged_arr, arr2[0]), arr2[1:]
		} else {
			merged_arr, arr1 = append(merged_arr, arr1[0]), arr1[1:]
		}
	}

	// one array has finished, drain the other
	for len(arr1) > 0 {
		merged_arr, arr1 = append(merged_arr, arr1[0]), arr1[1:]
	}
	for len(arr2) > 0 {
		merged_arr, arr2 = append(merged_arr, arr2[0]), arr2[1:]
	}

	return merged_arr
}

func mergesort(arr []int) []int {

	if len(arr) == 1 {
		return arr
	}

	arr1 := arr[0:int(len(arr)/2)]
	arr2 := arr[int(len(arr)/2):(len(arr))]

	arr1 = mergesort(arr1)
	arr2 = mergesort(arr2)

	return merge(arr1, arr2)
}

